function News(){}News.prototype.listenUploadFileEvent=function(){var t=$("#thumbnail-btn");t.change(function(){var n=t[0].files[0],e=new FormData;e.append("file",n),sdbuajax.post({url:"/cms/upload_file/",data:e,processData:!1,contentType:!1,success:function(n){var e;200===n.code&&(e=n.data.url,$("#InputImage").val(e))}})})},News.prototype.run=function(){this.listenUploadFileEvent()},$(function(){(new News).run()});